import React, { Component } from "react";

export default class about extends Component {
  render() {
    return (
      <div className="about row">
        <div className="about-text offset-1 col-sm-10">
          <h2 className="head">About Me</h2>
          Hello homo-sapiens ,myself Dev Arora and I am a student who is aiming
          to become a web developer.Trying to learn awesome things everyday and
          to become better day by day.Believe in the concept of minimiliast and
          would love to give your ideas into life by coding them and help you in
          any way possible.
        </div>
      </div>
    );
  }
}
